  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mark Twain NWR
  (Cannon Division) outlines Refuge accomplishments during the 1979 calendar year.
  The report begins with an introduction to the Refuge and information about weather
  conditions, habitat conditions, land acquisition activities, and the system status.
  Construction and maintenance are also described. Habitat management is covered;
  croplands, grasslands, wetlands, and wilderness areas are discussed. The wildlife
  section of the report discusses endangered and threatened species, migratory birds,
  and mammals. Interpretation and recreation activities are outlined; topics include
  information and interpretation, recreation, and law enforcement. Cooperative programs,
  items of interest, and safety information are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
